    value: Administrative expenses do not include rent payments because the North
      Carolina Republican Party owns the building located at 1506 Hillsborough Street,
      Raleigh, NC from where all our business is conducted.  Our Best efforts procedure
      for obtaining employer and occupation information complies with the Federal
      Election Commissions regulations.  Our original solicitation requests the contributors
      name, address, employer and occupation and states that this request is a requirement
      of federal law.  If we dont obtain the information, we send a letter within
      30 days requesting the employer and occupation information.  When the requested
      information is received, it is entered into the contributors record and noted
      on the next months FEC report. The postage for the Business Reply Mail account
      is the cost of self-addressed stamped envelopes that were mailed with the direct
      mail. The expenditures to Neopost were for postage on the postage meter which
      is used in the office. Some of the amounts reimbursed to staff members do not
      print on the FEC report because the vendors are below the $200 per year itemization
      level.
